package SequenceAlignment;

import org.junit.Assert;
import org.junit.Test;

import java.util.ArrayList;
import java.util.Arrays;

public class GenomeTest {

    String CoV = "";
    String CoV_2 = "";
    String RaTG13 = "";

    ArrayList<Character> alphabet = new ArrayList<>(
            Arrays.asList('a','c','g','t')
    );

    float[][] defaultCostMatrix = {
            {0,2,2,1},
            {2,0,1,2},
            {2,1,0,2},
            {1,2,2,0}
    };
    /**
     * The two strings are:
     *  the SARS-CoV virus, sequenced by the BC Center of Disease Control, 2004.
     *  the SARS-CoV-2 virus, sequenced by Giga-Science in Hong Kong, 2020.
     */
    @Test
    public void Test1() {
        double expectedValue = 10869;

        SequenceAlignmentLinearSpace seqAli = new SequenceAlignmentLinearSpace(CoV, CoV_2);
        seqAli.setAlphabetMap(alphabet);
        seqAli.setCostMatrix(defaultCostMatrix, 3);

        seqAli.computeAlignment();
        Assert.assertEquals(expectedValue, seqAli.getOptimalAlignmentCost(), 0.0001);
    }

    /**
     * The two strings are:
     *  the Vat coronavirus RaTG13, sequenced by the Wuhan Institute of Virology, 2020
     *  the SARS-CoV-2 virus, sequenced by Giga-Science in Hong Kong, 2020.
     */
    @Test
    public void Test2() {
        double expectedValue = 2227;
    }
}
